import logo from './logo.svg';
import './App.scss';

function App() {
  return (
    <>
      <header>
        <h1>Super Cool Website</h1>  
        <img src={logo} className="App-logo" alt="logo" />
        <span className="tagline">is super cool!</span>
        </header>
        <div className="stripe"></div>
      <main> Super Cool Main</main>
      <footer>
        <p> Made with love by <a href="https://github.com/cvcastano" target="blank" >Caro</a> </p></footer>

    </>
  );
}

export default App;
